{choices ?
<FormControl>
  <InputLabel id={labelId}>{label}</InputLabel>
  <Select 
    displayEmpty
    value= {
    stateValue == null ? 
        defaultValue != null  ?
        defaultValue :
        "":
    stateValue} 
    disabled={disabled}
    labelWidth={labelWidth}
    id={id}
    labelId={labelId}
    onChange={handleChange}
    onClick={handleClick}
    name={name}
  
  >
    <CustomMenuItem value="">
      <em>Click to Select</em>
    </CustomMenuItem>
    {choices.map((choice, index) => <CustomMenuItem className="dropdown-choice" key={index} value={choice.value} id={index} > 
      {choice.caption}
    </CustomMenuItem>)}
  </Select>
  <FormHelperText>{helperText}</FormHelperText>
</FormControl>:  <div>Warning: Dropdown widget needs choices</div>}

{choices ? <FormControl component="fieldset">
    <RadioGroup
   
        row={row}
       onChange={handleChange}       
       id={id}
>
        {choices.map((choice, index) => 
            <FormControlLabel
                key={index}
                control={
                    <Radio
     name={name}  id={gqlId + '-radio' + String(index)}
                       name={name}
                       value={choice.value}
                        checked={
                            (value == null) ? 
                                (defaultValue != null) ?
                                    defaultValue == choice.value :
                                false :
                              value == choice.value }
                              onClick = {(e) => {setValue(e.target.value)}}
                        disabled={disabled} /> }
                label=<span className="widget-choice">{choice.caption}</span>
            />)}
    </RadioGroup>
  </FormControl> : <div>Warning: RadioButtons widget needs choices</div>}

{useLocation ? (() => {const RenderGeolocation = geolocated({watchPosition: true})(BaseGeolocation); return <RenderGeolocation /> })(): <span className="geolocation-helper-text">Please click the button below to allow tracking</span>}
